import React from 'react'
import './Checkbox.scss'


class Checkbox extends ReactComponent {
    constructor(props) {
        super(props)
    }
    render() {
        return (
            <div>
                <input 
                    className='checkbox-custom' 
                    type="checkbox" 
                    id={props.id}
                />
                <label for={props.id}>{props.task}</label>
            </div>
        )

    }
}

export default Checkbox
